import React, { Component } from 'react';

import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import DeleteIcon from '@material-ui/icons/Delete';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';

import IconButton from '@material-ui/core/IconButton';
import CreateIcon from '@material-ui/icons/Create';
import CheckIcon from '@material-ui/icons/Check';
import CloseIcon from '@material-ui/icons/Close';

import { Typography } from '@material-ui/core';
import moment from 'moment'




const TableList = ({ items }) => (
    <Paper style={{
        width: '100%',
        marginTop: 15,
        overflowX: 'auto'
    }}>
        <Typography variant="h6" id="tableTitle" style={{ margin: 10 }}>
            Lista de Despesas
        </Typography>
        <Table>
            <TableHead>
                <TableRow>
                    <TableCell>Description</TableCell>
                    <TableCell align="right">Valor</TableCell>
                    <TableCell align="right">Data</TableCell>
                    <TableCell align="right">Pago?</TableCell>
                    <TableCell align="right"></TableCell>
                </TableRow>
            </TableHead>
            <TableBody>
                {items.map((item, i) => (
                    <TableRow key={i}>
                        <TableCell component="th" scope="row">
                            {item.description}
                        </TableCell>
                        <TableCell align="right">{item.value}</TableCell>
                        <TableCell align="right">{moment(item.date.toDate()).format('DD/MM/YYYY')}</TableCell>
                        <TableCell align="right">
                            {item.paid ?
                                <CheckIcon /> : <CloseIcon style={{color: "green"}}/>
                            }
                        </TableCell>
                        <TableCell align="right">
                            <IconButton size="small" aria-label="Delete" style={{ margin: 10 }}>
                                <DeleteIcon />
                            </IconButton>
                            <IconButton size="small" aria-label="Edit">
                                <CreateIcon />
                            </IconButton>
                        </TableCell>
                    </TableRow>
                ))}
            </TableBody>
        </Table>
    </Paper>
)

export default TableList
